func idFromMAC(mac string) int {
  if len(mac) == 17 {
    if mac[0:12] == "ab:cd:ef:00:" {
      i, err := strconv.ParseInt(mac[12:14]+mac[15:17], 16, 32)
      if err == nil {
        return int(i)
      }
    }
  }
  return -1
}

